import Form from "react-bootstrap/Form";
import "./ToolForm.css";

const ToolForm = () => {
  return (
    <div>
      <div
        style={{
          marginTop: "20%",
          width: "45%",
          marginLeft: "27.5%",
          marginRight: "27.5%",
          border: "1px solid lightGray",
          boxShadow: "0px 3px 10px 0px lightGray",
          padding: "3%",
          background: "lightGray"
        }}
      >
        <h2>TITLE</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ARTIST</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ISRC</h2>
        <Form.Control type="text" placeholder="placeholder" />
        <h2>ISWC</h2>
        <Form.Control type="text" placeholder="placeholder" />
      </div>
    </div>
  );
};

export default ToolForm;
